import { Directive, Input } from '@angular/core'

@Directive({
    selector: '[useFallbackImage]',
    host: {
        '[src]': 'checkPath(src)',
        '(error)': 'onError()',
    },
    standalone: true,
})
export class UseFallbackImageDirective {
    @Input() src!: string

    public defaultImg =
        'data:image/octet-stream;base64,'

    public onError() {
        this.src = this.defaultImg
    }

    public checkPath(src: string) {
        return src ? src : this.defaultImg
    }
}
